import React from 'react';
import './App.css';

import Board from './Board'


class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      dim: 2
    };
  }
  render() {
    return (
      <div className="App">
        <div>
          <button> - </button>
          <button onClick={this.onBack}> + </button>
        </div>
        <Board dim={this.state.dim}/>
      </div>
    );  
  }

}

export default App;
